import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {

    super();

  }

  render() {

    return (
      <div className="App">
        <img src={logo}></img>
        <h1>learn react</h1>
      </div>
    );

  }
}

export default App;
